const DystopiaTheme = ({ setTheme }: { setTheme: any }) => {
  const findMedianSortedArrays = (nums1: number[], nums2: number[]): number => {
    let mergeArray = [...nums1, ...nums2];
    mergeArray.sort();
    let length = mergeArray.length;
    if (length === 1) {
      return mergeArray[0];
    } else if (length % 2 === 0) {
      console.log(mergeArray[length / 2]);
      return mergeArray[length / 2];
    } else {
      console.log((mergeArray[length / 2] + mergeArray[length / 2 + 1]) / 2);
      return (mergeArray[length / 2] + mergeArray[length / 2 + 1]) / 2;
    }
  };
  findMedianSortedArrays([], [1]);
  return (
    <div className=" themeSwitcherContainer">
      <div className="dystopia">
        <div className="pageGlitch">Dystopia Page</div>
        <div className="pageLabel">Dystopia Page</div>
      </div>
    </div>
  );
};
export default DystopiaTheme;
